window.bookSummaryJSON = "<p>An ancient, alien technology that will change what it means to be human, a conspiracy begun before the first pyramid was built, and a world threatened by an unimaginable horror. </p> <p>Deep in the Indian Ocean, Dr. Selene Khan enters an underwater dome thousands of years old, one that is fully operational. She barely escapes to the surface, only to discover that her research vessel has vanished. Can she make it to shore 100 miles away? </p> <p>On the other side of the world, Agent Jack Elliot uncovers an impossible 900 grams of antimatter. The trail leads him to Egypt, betrayal, and a sinister brainwashing facility. There, in a desperate move, he rescues Dr. Selene Khan, fleeing with her into the desert. </p> <p>Together, Selene and Jack race to unravel a global conspiracy and learn the truth about an ancient, alien artifact and how civilization really began. Two people must summon the courage and extraordinary ability to stop the world's oldest plan from plunging humanity onto a twisted, evolutionary path. </p> <p><i>Artifact</i> is a lightning-paced adventure, utterly unpredictable right up to its stunning conclusion. </p>"; 
